import React from 'react';
import Layout from './Layout';

const BasePage = () => {
  return (
    <Layout>
      {/* Main content of your page goes here */}
      <div>
        <h1>Your Page Content</h1>
        <p>This is the main content of your page.</p>
      </div>
    </Layout>
  );
};

export default BasePage;
